import React from "react";

const Login = () => {
  return (
    <div className="login">
      <form className="loginForm">
        <label>Email</label>
        <input type="email" placeholder="Enter your email" />
        <label>Password</label>
        <input type="password" placeholder="Enter your password" />
      </form>
    </div>
  );
};

export default Login;
